import React from 'react';
import { useThemeSettings } from '../../context/theme/ThemeSettingsContext/ThemeSettingsContext';

const TestComponent = () => {
  const themeSettings = useThemeSettings();

  return (
    <div
      style={{
        backgroundColor: themeSettings.colors.background,
        color: themeSettings.colors.text,
        padding: '20px',
        borderRadius: '10px',
      }}
    >
      <h3>Test Dark Mode</h3>
      <button
        style={{
          backgroundColor: themeSettings.colors.buttonBackground,
          color: themeSettings.colors.buttonText,
          borderColor: themeSettings.colors.buttonBorderColor,
          padding: '10px 20px',
          borderRadius: '5px',
        }}
      >
        Test Button
      </button>
    </div>
  );
};

export default TestComponent;
